webpackJsonp([74954602754505],{501:function(A,e){A.exports={data:{site:{siteMetadata:{title:"Chris Frewin's Full Stack, Web Development, Blockchain, Machine Learning, & Natural Language Processing Blog.",author:"Chris Frewin"}},markdownRemark:{id:"/Users/chris/projects/chrisfrew.in/src/pages/laptop-stickers/index.md absPath of file >>> MarkdownRemark",html:'<h1>Laptop Stickers!</h1>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/laptopstickers1-ce10386796d1b866b5dd08091672a70c-b2a60.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="So hipster. Much win. Yes."\n        title=""\n        src="/static/laptopstickers1-ce10386796d1b866b5dd08091672a70c-f8fb9.jpg"\n        srcset="/static/laptopstickers1-ce10386796d1b866b5dd08091672a70c-e8976.jpg 148w,\n/static/laptopstickers1-ce10386796d1b866b5dd08091672a70c-63df2.jpg 295w,\n/static/laptopstickers1-ce10386796d1b866b5dd08091672a70c-f8fb9.jpg 590w,\n/static/laptopstickers1-ce10386796d1b866b5dd08091672a70c-85e3d.jpg 885w,\n/static/laptopstickers1-ce10386796d1b866b5dd08091672a70c-d1924.jpg 1180w,\n/static/laptopstickers1-ce10386796d1b866b5dd08091672a70c-9452e.jpg 1770w,\n/static/laptopstickers1-ce10386796d1b866b5dd08091672a70c-b2a60.jpg 3264w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>Nothing shows others better that you are a humble, totally epic developer, than putting really cheap stickers on your really expensive laptop!</p>\n<p>(Okay, I can’t be <em>that</em> humble since I’m bragging about a few 50¢ stickers on a blog - and I’m even wrong on a second account - my Mac here is used, from 2013, and only set me back about $700 😄)</p>\n<h1>Tech stack</h1>\n<p>Okay, I’m lying; there are a few stickers there of tools I haven’t used in one of my applications yet, but am learning and plan to very soon:</p>\n<ul>\n<li>Redux</li>\n<li>TypeScript</li>\n<li>ReactiveX</li>\n</ul>\n<p>Otherwise, it’s my honest-to-goodness workflow tools.</p>\n<h1>So You Wanna Be Cool Too, Eh?</h1>\n<p>I ordered all of these on <a href="redbubble.com">redbubble.com</a> No, no, it’s not what you think, its not an affiliate link! In fact, a good start portal for RedBubble is <a href="devstickers.com">devstickers.com</a>. Unfortunately, I found I often had to find the 4-per-page stickers in order to have a sticker size that was suitable for me, <em>obviously</em> so I could fit as many dev stickers as possible on my laptop 😂 - see the picture for reference.</p>\n<p>Cheers! 🍺</p>',frontmatter:{title:"My Laptop Stickers Arrived! Am I a Real Developer Now?!",date:"December 19, 2017",draft:!1}}},pathContext:{slug:"/laptop-stickers/"}}}});
